    const unpack_stroke_type=st=>{
        const stroke1=[],stroke2=[];
        for (let i=0;i<st.length;i++) {
            const cod=st.codePointAt(i)-0x3a;
            // console.log(cod>>3,cod%8,cod,st[i])
            const st1=String.fromCharCode( 0x30+ (cod >> 3));  
            const st2=String.fromCharCode( 0x30+ (cod%8));
            stroke1.push(st1);
            stroke2.push(st2);
        }
        return [stroke1,stroke2];
    };

    const forEachRLE=(str,cb)=>{ //copy from pitaka/utils/rlestr.js
        if (!str)return str;
        let i=1,ch=String.fromCodePoint(str.codePointAt(0)),repeat=0,pos=0,done=false;
        
        while (i<str.length) {
            let code=str.codePointAt(i);
            if (code==0x30) { //invalid zero at the begining , maybe as a separator
                i++;continue;
            } 
            while (i<str.length&&code>=0x30&&code<=0x39) {
                i++;
                repeat=repeat*10+(code-0x30);
                code=str.codePointAt(i);
            }
            if (cb(ch.codePointAt(0),pos,repeat)) {
                done=true;
                break; //ch 在 pos 出現，又重覆了 repeat 次
            }
            if (repeat) pos+=repeat;
            ch=String.fromCodePoint(str.codePointAt(i));
            
            repeat=0;
            i++;
            if (code>0xffff) i++;
            pos++; 
        }
        if (!done) cb(ch.codePointAt(0),pos,repeat);
    };

