    const fibSearch=(arr, x, n)=>{ // Returns index of x if present, else returns -1
        if (typeof n=='undefined') n=arr.length;
        let fibMMm2 = 0; // (m-2)'th Fibonacci No.
        let fibMMm1 = 1; // (m-1)'th Fibonacci No.
        let fibM = fibMMm2 + fibMMm1; // m'th Fibonacci
        let i;
        while (fibM < n)  {
            fibMMm2 = fibMMm1;
            fibMMm1 = fibM;
            fibM = fibMMm2 + fibMMm1;
        }
        let offset = -1;
        while (fibM > 1)  { // Check if fibMm2 is a valid location
            i = Math.min(offset + fibMMm2, n-1);
            if (arr[i] < x)  {
                fibM = fibMMm1;
                fibMMm1 = fibMMm2;
                fibMMm2 = fibM - fibMMm1;
                offset = i;
            }
            else if (arr[i] > x)  {
                fibM = fibMMm2;
                fibMMm1 = fibMMm1 - fibMMm2;
                fibMMm2 = fibM - fibMMm1;
            }
            else {
              return i;
            }
        }
        if (x>arr[i]) return i;
        else if (arr[i]>x) return i-1;
        return n;
    };

    //獨體字、構字序、部件、筆划數  , 孳乳數      孳乳數的部件位置 
    const isFactor=cp=>{
        if (typeof cp=='string') cp=cp.codePointAt(0);
        return factorArray.indexOf(cp)>-1;
    };

    const isPrime=cp=>{
        if (typeof cp=='string') cp=cp.codePointAt(0);
        return primeArray.indexOf(cp)>-1;
    };
    const splitUTF32=s=>{ //from pitaka/utils
        let i=0;
        const out=[];
        while (i<s.length) {
            const code=s.codePointAt(i);
            out.push(code);
            i++;
            if (code>0xffff) i++;
        }
        return out;
    };

    const valsOf=(cparr,RLE)=>{
        let i=0,found=false;
        let now=cparr[i][0];
        forEachRLE(RLE,(idc,pos,repeat)=>{
            while (pos>now&&i<cparr.length-1) {
                i++;
                now=cparr[i][0];
            }
            if (idc!==0x20 && now>=pos && now<=pos+repeat) {
                cparr[i][1].push(idc);
                found=true;
                if (i==cparr.length-1) return found;
            }
        }); 
        return found;
    };

    const valOf=(ch,RLE)=>{
        const cp=(typeof ch=='number')?ch:ch.codePointAt(0);
        let out='';
        forEachRLE(RLE,(idc,pos,repeat)=>{
            if (idc!==0x20 && cp>=pos && cp<=pos+repeat) {
                out=idc;
                return true;
            }            
        }); 
        return out;
    };

    const matchIDC=(part,narr)=> {
        let partcp=part;
        if (typeof part=='string')  partcp=part.trim().codePointAt(0);
        if (!partcp)return;
        let out=[];
        forEachRLE(idsarr[narr],(idc,pos,repeat)=>{
            if (!idc ||idc==0x3000||idc==0x20) return;
            for (let i=pos;i<=pos+repeat;i++) {
                if (idc==partcp) {
                    out.push(i);
                }
            }
        }); 
        return out;
    };
    const getFactor=ch=> {
        const out=[];
        if (Array.isArray(ch)) {
            //array to hold sorted ch and result
            const res=ch.map((c,idx)=>[typeof c=='string'?c.codePointAt(0):c,[],idx]); 
            res.sort((a,b)=>a[0]-b[0]);  //valsOf assuming in codepoint order
            
            for (let i=0;i<idsarr.length;i++) {
                const r=valsOf(res,idsarr[i]);
                if (!r) break;
            }
            res.sort((a,b)=>a[2]-b[2]); //sort back to input order
            return res.filter(item=>!!item[1]).map(item=>[item[0],item[1]]);
        } else {
            for (let i=0;i<idsarr.length;i++) {
                const r=valOf(ch,idsarr[i]);
                if (!r) break;
                out.push(r);
            }
            return out.filter(item=>!!item);
        }
        
    };
    const expandFactor=(f,out)=>{
        if (f=='　') return;
        if (isPrime(f)) {
            out.push(f);
        } else {
            const child=factorsOf(f,true);
            out.push(f);
            if (child.length) {
                out.push(1); //level down
                out.push(...child);
                out.push(-1); //level up
            }
        }
    };
    const factorsOf=(ch,recursive=false)=>{
        const r= getFactor(ch);
        if (!recursive) return r;
        if (r) {
            if (Array.isArray(ch)) {
                for (let i=0;i<ch.length;i++) {
                    const out=[];
                    r[i][1].forEach(f=>expandFactor(f,out));
                    r[i][1]=out;
                }
                return r;
            } else {
                let out=[];
                r.forEach(f=>expandFactor(f,out));
                return out;
            }
        }
    };
